                        let y = ["#0099FF", "#168AF8", "#2C7CF0", "#426DE9", "#575FE2",
                                 "#6D50DB", "#8342D3", "#9933CC",]
                        let valId = Math.max(data.units, data.hundreds)
                        if (data.gems.gte(1e4)) return {"background-color": y[valId-1]}
                        return {"background-color": x[valId-1]}
